#
# TABLE STRUCTURE FOR: tbl_dpt
#

DROP TABLE IF EXISTS `tbl_dpt`;

CREATE TABLE `tbl_dpt` (
  `id` smallint(4) NOT NULL AUTO_INCREMENT,
  `nis` varchar(10) NOT NULL,
  `nama` varchar(30) NOT NULL,
  `kelas` varchar(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=379 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: tbl_hasil
#

DROP TABLE IF EXISTS `tbl_hasil`;

CREATE TABLE `tbl_hasil` (
  `id` smallint(4) NOT NULL AUTO_INCREMENT,
  `nis` varchar(10) NOT NULL,
  `pilihan` tinyint(2) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `nis` (`nis`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: tbl_kandidat
#

DROP TABLE IF EXISTS `tbl_kandidat`;

CREATE TABLE `tbl_kandidat` (
  `id` tinyint(2) NOT NULL AUTO_INCREMENT,
  `no_urut` tinyint(2) NOT NULL,
  `nis` varchar(10) NOT NULL,
  `nama` varchar(30) NOT NULL,
  `nama_panggilan` varchar(20) NOT NULL,
  `kelas` varchar(10) NOT NULL,
  `posisi` varchar(20) NOT NULL,
  `foto` text NOT NULL,
  `visi` text,
  `misi` text,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;



